import axios from "axios"
import { useState } from "react";
import { getapi } from "../constant"
let [d,setD]=useState(null) 
const getResource = ()=>{
  let resp="";  

  resp = fetch(getapi)
  .then(response => response.json())
  .then(data => {
      // console.log(data);
      resp = data

      d=data;
      setD(d);
  });
  console.log(d)
  return resp;

}
export default getResource;
